import React, { Component } from 'react';
import Header from './Header/Header';
import Home from './Home/Home';
import Aboutme from './About/Aboutme';
import './index.css';

export default class Index extends Component {
    render() {
        return (
            <div className="main-container">
            <Header />
            <Aboutme />
            <Home />
            </div>
    );
    }
}
